        [Fact]
        public async Task UpdateImageLiveStockCircle_SuccessWithMultipleImages_UploadsAndSavesImages()
        {
            // Arrange
            var livestockCircleId = Guid.NewGuid();
            var request = new UpdateImageLiveStockCircle
            {
                Images = new List<string> { "data:image/jpeg;base64,", "data:image/jpeg;base64," }
            };
            var uploadedLinks = new List<string> { "https://cloudinary.com/image1.jpg", "https://cloudinary.com/image2.jpg" };

            _cloudinaryCloudServiceMock
                .Setup(x => x.UploadImage(It.IsAny<string>(), "livestockcircle", It.IsAny<CancellationToken>()))
                .ReturnsAsync((string base64, string folder, CancellationToken ct) => uploadedLinks[request.Images.IndexOf(base64)]);
            _imageLiveStockCircleRepositoryMock
                .Setup(x => x.Insert(It.IsAny<ImageLivestockCircle>()));
            _imageLiveStockCircleRepositoryMock
                .Setup(x => x.CommitAsync(It.IsAny<CancellationToken>()))
                .ReturnsAsync(1);

            // Act
            var (success, errorMessage) = await _livestockCircleService.UpdateImageLiveStocCircle(livestockCircleId, request, default);

            // Assert
            Assert.True(success);
            Assert.Null(errorMessage);
            _imageLiveStockCircleRepositoryMock.Verify(x => x.Insert(It.Is<ImageLivestockCircle>(img => img.LivestockCircleId == livestockCircleId && img.Thumnail == "false")), Times.Exactly(2));
            _imageLiveStockCircleRepositoryMock.Verify(x => x.CommitAsync(It.IsAny<CancellationToken>()), Times.Once());
            _cloudinaryCloudServiceMock.Verify(x => x.UploadImage(It.IsAny<string>(), "livestockcircle", It.IsAny<CancellationToken>()), Times.Exactly(2));
        }

