        [Fact]
        public async Task UpdateImageLiveStockCircle_RepositoryExceptionOnCommit_ReturnsError()
        {
            // Arrange
            var livestockCircleId = Guid.NewGuid();
            var request = new UpdateImageLiveStockCircle
            {
                Images = new List<string> { "data:image/jpeg;base64," }
            };

            _cloudinaryCloudServiceMock
                .Setup(x => x.UploadImage(It.IsAny<string>(), "livestockcircle", It.IsAny<CancellationToken>()))
                .ReturnsAsync("https://cloudinary.com/image1.jpg");
            _imageLiveStockCircleRepositoryMock
                .Setup(x => x.Insert(It.IsAny<ImageLivestockCircle>()));
            _imageLiveStockCircleRepositoryMock
                .Setup(x => x.CommitAsync(It.IsAny<CancellationToken>()))
                .ThrowsAsync(new Exception("Commit failed"));

            // Act
            var (success, errorMessage) = await _livestockCircleService.UpdateImageLiveStocCircle(livestockCircleId, request, default);

            // Assert
            Assert.False(success);
            Assert.Equal("Lỗi khi tạo thức ăn: Commit failed", errorMessage);
            _imageLiveStockCircleRepositoryMock.Verify(x => x.Insert(It.IsAny<ImageLivestockCircle>()), Times.Once());
            _imageLiveStockCircleRepositoryMock.Verify(x => x.CommitAsync(It.IsAny<CancellationToken>()), Times.Once());
            _cloudinaryCloudServiceMock.Verify(x => x.UploadImage(It.IsAny<string>(), "livestockcircle", It.IsAny<CancellationToken>()), Times.Once());
        }

